import React from "react";

// Here we import bootstrap for access to some additional styling
import "bootstrap/dist/css/bootstrap.min.css";
// Here import a CSS file as a dependency
import "../styles/Style.css";
import { Link } from "react-router-dom";
import { Navbar, Nav } from "react-bootstrap";

const styles = {
  heading: {
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    alignItems: "center",
    background: `url("./menu-bg.jpg")`,
    backgroundSize: "contain",
    backgroundRepeat: "repeat",
    lineHeight: "1.5",
    height: "100px",
    fontSize: "1.5rem",
    fontWeight: "600",
  },
};
function Header() {
  // Returning the header component with the title
  return (
    <header className="header">
      <h1>Kateryna's Stetsenko Portfolio</h1>
      <meta
        name="viewport"
        content="width=device-width, initial-scale=1"
      ></meta>
      <div style={styles.heading}>
        <Navbar expand="md" variant="light">
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ml-auto">
              <Nav.Link as={Link} to="/">
                About Me
              </Nav.Link>
              <Nav.Link as={Link} to="/project-all">
                All projects
              </Nav.Link>
              <Nav.Link as={Link} to="/contact">
                Contact Me
              </Nav.Link>
              <Nav.Link as={Link} to="/resume">
                My resume
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
    </header>
  );
}

export default Header;
